        $this->execute("INSERT INTO `tipofday` (`id`, `title`, `content`) VALUES (1,'Sorting lists','Most lists can be sorted anyway you like. Just click on the column title to sort the table on that column. Clicking another time on the same column will reverse the sort order.'),(2,'Undo a purchase','If a customer decides not to buy something after you made the purchase: check the item in the list of purchases and hit the red \'Delete\' button.'),(3,'Changing the amount of drops','If you want to change the amount of drops of a family, for example because you changed the amount of family members, you find the people in the \'Check-in\' section of the site, click the checkbox next to the family name and hit the \'Give drops\' button. <br /><br /> You can enter an amount to be added to the family as a whole or an amount for each adult or child. And ofcourse, you can also enter a negative number.'),(4,'Mobile','Did you know that this Drop Market system works perfectly on most smartphones? Just open \'https://market.drapenihavet.no\' in your browser.'),(5,'Quick purchase','If you want to quickly submit a form you can simply use the \'cmd + enter\' or \'ctrl + enter\' shortcut!'),(6,'Sorting','Did you know you that in a list you can sort multiple columns simultaneously by holding down the Shift key and clicking a second, third or even fourth column header!');");
